import React from "react";
import './ProfileUploads.css'
import Grid from '@material-ui/core/Grid';

const UploadItem = ({key, uploadURL, status}) => (
    <Grid item xs={4} sp>
        <iframe className={'videoUpload'} src={uploadURL}>
        </iframe>
    </Grid>
);

export default UploadItem;
